Анализ мочи по Нечипоренко:
Анализ мочи по Нечипоренко впервые предложил советский врач и учёный Нечипоренко, Александр Захарович (1916 (in English: 1916)—1980 (in English: 1980)). В настоящее время широко используется, особенно терапевтами и нефрологами. Цель анализа состоит в определении количества форменных элементов — лейкоцитов, эритроцитов и гиалиновых цилиндров — в единице объёма мочи (в 1 мл). В норме допустимы следующие показатели: Лейкоциты (in English: White blood cell) — до 2000 в 1 мл;
Эритроциты (in English: Red blood cell) — до 1000 в 1 мл.
Цилиндры гиалиновые - до 20 в 1 мл.

