Показатель состояния плода:
Показатель состояния плода (ПСП) — Метод математического анализа кардиотокограмм Кардиотокография (in English: Cardiotocography) во время беременности и в родах. Предложен профессором Демидов, Владимир Николаевич (in English: Vladimir Demidov) (Москва (in English: Moscow)) в 1983 год (in English: 1983). Оценка состояния плода во время беременности производится по интегральному диагностическому показателю ПСП — показателю состояния плода. Значения ПСП: 0—1,0 свидетельствует о наличии здорового плода;
1,1—2,0 — начальные нарушения состояния плода;
2,1—3,0 — выраженные нарушения состояния плода
3,1—4,0 — резко выраженные нарушения состояния плода.

